import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError("Please enter a URL.");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError("Backend not reachable.");
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <h1 style={styles.title}>AI Phishing URL Detector</h1>
        <p style={styles.subtitle}>
          Enter a URL to analyze using a Machine Learning phishing model.
        </p>

        <input
          type="text"
          placeholder="https://example.com"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          Analyze URL
        </button>

        {loading && <p style={styles.loading}>Analyzing...</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.resultBox}>
            <h2 style={styles.resultTitle}>Analysis Result</h2>

            <div style={styles.row}>
              <span>Final Prediction:</span>
              <strong
                style={{
                  color:
                    result.final_prediction === "Phishing"
                      ? "#d32f2f"
                      : "#2e7d32",
                }}
              >
                {result.final_prediction}
              </strong>
            </div>

            <div style={styles.row}>
              <span>ML Prediction:</span>
              <strong>{result.ml_prediction}</strong>
            </div>

            <div style={styles.row}>
              <span>ML Probability:</span>
              <strong>{(result.ml_probability * 100).toFixed(2)}%</strong>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

// ---------------- PROFESSIONAL STYLING ----------------

const styles = {
  page: {
    minHeight: "100vh",
    background: "#f5f7fa",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: 20,
    fontFamily: "'Inter', sans-serif",
  },

  card: {
    width: "100%",
    maxWidth: "480px",
    background: "#ffffff",
    padding: "32px",
    borderRadius: "12px",
    boxShadow: "0px 4px 20px rgba(0,0,0,0.08)",
  },

  title: {
    fontSize: "28px",
    fontWeight: "700",
    color: "#2d3436",
    marginBottom: "6px",
  },

  subtitle: {
    fontSize: "14px",
    color: "#636e72",
    marginBottom: "22px",
  },

  input: {
    width: "100%",
    padding: "14px",
    fontSize: "15px",
    borderRadius: "8px",
    border: "1px solid #dcdde1",
    marginBottom: "16px",
    outline: "none",
  },

  button: {
    width: "100%",
    padding: "14px",
    fontSize: "16px",
    fontWeight: "600",
    background: "#1976d2",
    color: "#fff",
    border: "none",
    borderRadius: "8px",
    cursor: "pointer",
    marginBottom: "20px",
  },

  loading: { color: "#555", textAlign: "center" },
  error: { color: "#d32f2f", textAlign: "center" },

  resultBox: {
    padding: "20px",
    borderRadius: "10px",
    background: "#f8f9fa",
    border: "1px solid #e0e0e0",
  },

  resultTitle: {
    fontSize: "20px",
    fontWeight: "600",
    marginBottom: "16px",
    color: "#2d3436",
  },

  row: {
    display: "flex",
    justifyContent: "space-between",
    marginBottom: "10px",
    fontSize: "15px",
  },
};

export default App;
